import React, { Component } from 'react';
import './App.css';
import DogSpan from './DogSpan'

pupsUrl = ''

class App extends Component {

  componentDidMount(){
    fetch()
  }

  render() {
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">
      <DogSpan />
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  };
}

export default App;
